std::string join(const std::vector & s, const std::string & token)
{
    size_t count{ 0 };
    std::string tmp;

    for (const auto & str : s)
    {
        count++;
        tmp += str;

        if (count != s.size())
        {
            tmp += token;
        }
    }

    return tmp;
}
